import React from 'react'
import './nobooking.css'; // Import your custom CSS file



function Nobooking() {
  return (
    <div className='container-fluid nbg' >
        <div className="container">
        <img
            src={logo}
            alt="Your logo"
            className="n-img" // Apply custom CSS class if needed
          /> 
        </div>
    </div>
  )
}

export default Nobooking
